import React from 'react'

const MyProgressionReflection = ({reflection}) => {
  return (
    <div className="myprogression-reflection">
      <h1>{reflection.title}</h1>
      <h3>{reflection.question1}</h3>
    </div>
  )
}

export default MyProgressionReflection
